import React, { useState } from 'react'
import TextField from '@mui/material/TextField'
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import InputLabel from '@mui/material/InputLabel';
import notes from '../assets/notes.PNG'
import Select from '@mui/material/Select';
import {
    Link
  } from "react-router-dom";

const Login = () => {
    const [Username, setUsername] = useState('')
    const [Password, setPassword] = useState('')

    return (
        <div className='w-6/6 h-6/6 text-center'>
            <img src={notes} alt='img' className='w-full h-full'>
            <h1 className='text-indigo-900 text-3xl' style={{ paddingTop: '3rem' }}>Login to your account</h1>
            <div className='w-3/6 shadow-cardShadow' style={{margin:'auto',marginTop:'4rem', padding:'2rem'}}>
            <form className='grid'>
                <TextField
                    sx={{ m: 1, minWidth: 360 }}
                    label="Enter Username"
                    id="standard-size-normal"
                    variant="standard"
                    className='row text-left'
                    name='username'
                    onChange={(e) => setUsername(e.target.value)}
                />

                <TextField
                    sx={{ m: 1, minWidth: 360 }}
                    label="Enter Password"
                    id="standard-size-normal"
                    variant="standard"
                    className='row text-left'
                    name='password'
                    onChange={(e) => setUsername(e.target.value)}
                />

                <button type='submit' onClick className='w-full bg-purple text-white col hover:text-gray-400' style={{ marginTop: "2rem",margin:'auto', padding: '7px' }}>Login</button>
            </form>
            </div>
            <p className='text-gray-500 text-lg text-center' style={{marginTop:'4rem'}}>Already have an account? <Link to='/register' className='text-blue-800 hover:text-blue-500'>Sign Up Here</Link></p> 
            </img>
        </div>
    )
}

export default Login
